        "CH_DESCRIPTION": "阿卡依曼徽章就在这里的什么地方。这是我们进入奥洛林办公室所需的第一个徽章。##这个区域有不少裂隙，徽章很可能就在其中一个裂隙里。##我们去会会阿卡依曼的人，看看他们的能耐。",
        "TW_NAME": "阿卡依曼宿舍",
        "TW_DESCRIPTION": "阿卡依曼徽章就在這裡的什麼地方。這是我們進入奧洛林辦公室所需的第一個徽章。##這個區域有不少裂隙，徽章很可能就在其中一個裂隙裡。##我們去會會阿卡依曼的人，看看他們的能耐。",
        "JP_NAME": "アルカイマン寮",
        "JP_DESCRIPTION": "アルカイマンの紋章がこのエリアのどこかにある。オローリンの執務室へ入るために必要な最初の紋章だ。##このエリアにはかなりの数の裂け目があり、紋章はおそらくその中のどこかにある。##アルカイマンへ確かめに行こう。",
        "DE_NAME": "Der Arkaiman-Schlafsaal",
        "DE_DESCRIPTION": "Irgendwo hier sollte sich das Arkaiman-Emblem befinden. Es ist das erste Emblem, das wir brauchen, um in Olorins Büro zu gelangen.##Hier gibt es einige Risse, und das Emblem ist wahrscheinlich in einem.##Mal sehen, ob der Arkaiman zuschnappt ...",
        "ES_NAME": "El Dormitorio de Arcaimán",
        "ES_DESCRIPTION": "El Emblema de Arcaimán se encuentra en algún lugar de esta zona. Es el primer Emblema que necesitaremos para entrar en la oficina de Olorín.##Hay muchas Brechas en esta área, probablemente el Emblema esté en una de ellas.##Vamos a buscar a los Arcaimanes, a ver si muerden.",
        "RU_NAME": "Общежитие Аркаиман",
        "RU_DESCRIPTION": "Эмблема Аркаиман находится где-то в этой области. Это первая Эмблема, которую нам нужно получить, чтобы попасть в офис Олорина. В этой области довольно много Разрывов, Эмблема, вероятно, будет в одном из них. Давайте пойдем за Аркаиманами, посмотрим, клюнут ли они.",
