        "EN_NAME": "The Destructive Oblitelicans",
        "EN_DESCRIPTION": "The Oblitelican Emblem is located somewhere in this area. This is the third emblem we will need to access Olorin's office.##The Oblitelicans are particularly dangerous, but easily impressed. A little flick of the wrist should discourage them.##So let's fly to the Oblitelicans!",
        "FR_NAME": "Les Oblitélicans Destructeurs",
        "FR_DESCRIPTION": "L'Emblème des Oblitélicans se trouve quelque part dans cette zone, il s'agit du troisième Emblème dont nous aurons besoin pour accéder au bureau d'Olorin.##Les Oblitélicans sont particulièrement dangereux, mais facilement impressionnables. Une petite pichenette devrait les décourager.##Alors, volons en direction des Oblitélicans !",
        "CH_NAME": "难缠的奥比利提坎师生",
        "CH_DESCRIPTION": "奥比利提坎徽章就在这里的什么地方。这是我们进入奥洛林办公室所需的第三个徽章。##奥比利提坎特别危险，但很容易搞定，稍微动动手腕就能吓退他们。##所以，我们去会会奥比利提坎师生吧！",
        "TW_NAME": "難纏的奧比利提坎",
        "TW_DESCRIPTION": "奧比利提坎徽章就在這裡的什麼地方。這是我們進入奧洛林辦公室所需的第三個徽章。##奧比利提坎特別危險，但很容易搞定，稍微動動手腕就能嚇退他們。##所以，我們去會會奧比利提坎師生吧！",
        "JP_NAME": "破壊のオブリテリカン",
        "JP_DESCRIPTION": "オブリテリカンの紋章がこのエリアのどこかにある。オローリンの執務室へ入るために必要な3番目の紋章だ。##オブリテリカンは特に危険だが、感心させるのも簡単だ。手首を少し動かすだけで、動きを思いとどまらせることができる。##さあ、オブリテリカンへひとっとびだ！",
        "DE_NAME": "Die zerstörerischen Oblitelikane",
        "DE_DESCRIPTION": "Hier in der Nähe befindet sich das Oblitelikan-Emblem. Das ist das dritte Emblem, das wir brauchen, um in Olorins Büro zu gelangen.##Das Haus Oblitelikan ist zwar besonders gefährlich, aber auch einfach zu beeindrucken. Mit ein paar Tricks bringen wir sie zum Spuren.##Dann wollen wir mal los!",
        "ES_NAME": "Los Obliterlicanos Destructivos",
        "ES_DESCRIPTION": "El Emblema Obliterlicano se encuentra en algún lugar de esta zona. Es el tercer Emblema que necesitaremos para acceder a la oficina de Olorín.##Los Obliterlicanos son especialmente peligrosos, pero fáciles de impresionar. Un simple movimiento de muñeca debería bastar para ahuyentarlos.##¡Volemos hasta los Obliterlicanos!",
        "RU_NAME": "Разрушительные Облитеканцы",
        "RU_DESCRIPTION": "Эмблема Облителиканов находится где-то в этой области. Это третья эмблема, которая нам нужна для доступа к офису Олорина. Облителиканы особенно опасны, но легко впечатляются. Небольшой взмах запястья должен их испугать. Так что давайте полетим к Облителиканам!",
