        "EN_NAME": "A Smell of Sauerkraut",
        "EN_DESCRIPTION": "To reach the Throne Room, we have to go through a secret path that passes under the restaurant \"Le Vieux Homard\" and that smells strongly of sauerkraut, but that leads to the castle. Then, we will have to walk up to the upper floors to reach the Royal Wing.##This is the fastest way to the Throne Room.#To Ohm Agad.##Sauerkraut (n.f): White cabbage cut into ribbons, lightly fermented in a brine.",
        "FR_NAME": "Une Odeur de Choucroute",
        "FR_DESCRIPTION": "Pour atteindre la Salle du Trône, nous devons passer par un chemin secret qui passe sous le restaurant \"Le Vieux Homard\" et qui sent fort la choucroute, mais qui rejoint le château. Ensuite, nous nous devrons remonter vers les étages supérieurs pour rejoindre l'Aile Royale.##C'est le chemin le plus rapide vers la Salle du Trône.#Vers Ohm Agad.##Choucroute (n.f) : Chou blanc découpé en rubans, que l'on fait légèrement fermenter dans une saumure.",
        "CH_NAME": "酸菜的味道",
        "CH_DESCRIPTION": "要到达王座厅，我们就必须穿过一条密道，它会经过“老龙虾”餐厅下方，散发着浓烈的酸菜味，但可以通往城堡。然后，我们得走上楼到达皇家侧殿。##这是到达王座厅的最快路径。#通往欧姆·阿加德那里。##酸菜（n.f）：切成条状，在盐水中轻微发酵的白菜。",
        "TW_NAME": "酸菜的味道",
        "TW_DESCRIPTION": "要到達王座廳，我們就必須穿過一條密道，它會經過「老龍蝦」餐廳下方，散發著濃烈的酸菜味，但可以通往城堡。然後，我們得走上樓到達皇家側殿。##這是到達王座廳的最快路徑。#通往歐姆·阿加德那裡。##酸菜（n.f）：切成條狀，在鹽水中輕微發酵的白菜。",
        "JP_NAME": "ザワークラウトの匂い",
        "JP_DESCRIPTION": "玉座の間に行くには、レストラン「古きオマール」の下を通る秘密の道を通らなければならない。そこは凄まじいザワークラウトの匂いがするが、城へと繋がっている。そして、王族の居塔に行くには上のフロアまで歩かなければならない。##これが、玉座の間への…#そしてオーム・アガドへの最短経路だ。##ザワークラウト（脚注）：リボン状に切った白キャベツを、塩水で軽く発酵させたもの。",
        "DE_NAME": "Es riecht nach Sauerkraut",
        "DE_DESCRIPTION": "Um in den Thronsaal zu gelangen, müssen wir durch einen Geheimgang, der unter dem Restaurant „Le Vieux Homard“ liegt und in dem es heftig nach Sauerkraut mieft. Immerhin führt er zum Schloss. Dann müssen nach oben, in den Königsflügel.##Das ist der schnellste Weg in den Thronsaal.#Und zu Ohm Eigad.",
        "ES_NAME": "Olor a Chucrut",
        "ES_DESCRIPTION": "Para llegar a la Sala del Trono, debemos atravesar un camino secreto que pasa por debajo del restaurante \"Le Vieux Homard\" y que huele intensamente a chucrut, pero nos llevará al castillo. Luego, tendremos que subir hasta los pisos superiores para llegar al Ala Real.##Este es el camino más rápido a la Sala del Trono.##¡A Ohm Agad!#Chucrut (m.): Col blanca fermentada en salmuera.",
        "RU_NAME": "Запах квашеной капусты",
        "RU_DESCRIPTION": "Чтобы добраться до Тронного зала, нам нужно пройти по секретному пути, который проходит под рестораном \"Le Vieux Homard\" и сильно пахнет квашеной капустой, но ведет к замку. Затем нам придется подняться на верхние этажи, чтобы добраться до Королевского крыла. Это самый быстрый путь к Тронному залу. Квашеная капуста (ж.р.): Белокочанная капуста, нарезанная полосками, слегка ферментированная в рассоле.",
