        "JP_DESCRIPTION": "ついに城にたどり着いた！最初の一歩を歩みだしたのだ。城は広いが、玉座の間は簡単に見つけられるはずだ。真ん中に大きな椅子がある部屋だ。##進め！",
        "DE_NAME": "Die Küche",
        "DE_DESCRIPTION": "Endlich sind wir im Schloss! Den ersten Schritt haben wir getan. Das Schloss ist zwar groß, aber den Thronsaal sollten wir schnell finden können. Da steht nämlich ein großer Stuhl drin.##Vorwärts!",
        "ES_NAME": "La Cocina Trasera",
